	<div class="container  CnTop CnBtm" :class="[isIphonex ? 'ixPaddCn':'']">
		
		<!--导航栏-->
		<allHead :headTil='langua.loTil' />
		
		<div class="headTop">
			<div class="headLogo logoIcon"></div>
			<div class="Hname">{{langua.programTil}}</div>
		</div>
		<div class="accredit">
			<div>{{langua.loAccredit}}</div>
			<div>·{{langua.loRemark}}</div>
			<button open-type="getUserInfo" @getuserinfo="bindgetuserinfo">{{langua.loYes}}</button>
		</div>
	</div>
</template>

<script> 
	import allHead from '../../components/head' 
	
	export default {
		data() {
			return {
				Request: this.$api.api.prototype, //请求头
				util: this.$util.util.prototype, //工具类
				langua:'',//静态文字的语种
			}
		},

		components: {
			allHead
		},
		computed: {
			isIphonex() {
				return this.$store.store.state.isIphonex
			},
		},
		methods: {
			//返回
			goBack(){
				wx.navigateBack();
			},
			bindgetuserinfo:function(e){
				var userInfo = e.mp.detail.userInfo;
				console.log(wx.getStorageSync('sessionkey'))
				this.getUserInfo(e.mp.detail.encryptedData,e.mp.detail.iv,userInfo);
				var that = this;
				wx.checkSession({
					success:function(res){
						console.log(res)
					},
					fail:function(){
						that.util.getSessionKey();
					}
				});
			},
			//获取用户信息接口
			getUserInfo(enc,iv,userInfo){
				var that = this;
				that.Request.getUserInfo(enc,iv)
					.then(res =>{
						console.log(res)
						if(res.code == 200){
							wx.setStorageSync('userInfo',userInfo);
							wx.setStorageSync('userId',res.data.userid);
							wx.navigateBack();
						}
					})
			},
			
		},
		onShow(){
			this.langua = this.$util.util.prototype.changeLanguage();
			
		}
	}
</script>

